function setActiveDot () {
    dots.forEach((dot) => {
        dot.classList.remove("active-dot");
        const dotIndex = dot.dataset.index;
        if (Number(dotIndex) === currentPosition) {
            dot.classList.add("active-dot");
        };
    });
}


